import {Link,Outlet} from 'react-router-dom'
import './layout.css'
const layout = ()=>{
    return(
        // <div>
        //     <a href="product.js">Product</a>
        //     <a href="user.js">User information</a>
        // </div>    
        <div>
        <Link className='pro' to='/product'>Product</Link>
        <Link className='user' to='/user'>User information</Link>
        <Link to='/table'>Table</Link>
        <Outlet />
        </div>
    )
};
export default layout;
